Compare arrays and filter, using MongoDB aggregation<p>For my DB, I wrote the following pipeline:</p>
<pre><code>let orders = await Order.aggregate(
        {
          $unwind: &quot;$candidate&quot;,
        },
        {
          $lookup: {
            from: &quot;groups&quot;,
            localField: &quot;candidate.groupId&quot;,
            foreignField: &quot;_id&quot;,
            as: &quot;groupData&quot;,
          },
        },
        {
          $lookup: {
            from: &quot;users&quot;,
            let: {
              id: &quot;$candidate.groupId&quot;,
            },
            pipeline: [
              { $match: { groupId: { $ne: null } } },
              {
                $match: {
                  $expr: { $in: [&quot;$$id&quot;, &quot;$groupId&quot;] },
                },
              },
              { $project: { name: 1, email: 1, _id: 1 } },
            ],
            as: &quot;members&quot;,
          },
        },
        { $match: { &quot;members._id&quot;: new ObjectId(req.userId) } },
        {
          $lookup: {
            from: &quot;users&quot;,
            let: { ids: &quot;$candidate.autonomousId&quot; },
            pipeline: [
              {
                $match: {
                  $expr: { $in: [&quot;$_id&quot;, &quot;$$ids&quot;] },
                },
              },
              { $project: { name: 1, email: 1, _id: 1 } },
            ],
            as: &quot;candidate&quot;,
          },
        },
        {
          $project: {
            groupData: 1,
            members: 1,
            candidate: 1,
            stillAvailable: 1,
            _id: 0,
          },
        }
      ).toArray();
</code></pre>
<p>The output was the expected...</p>
<pre><code>{ candidate:
    [ { _id: 601817dc2eeecd17db3a68f6,
        name: 'Maria' },
      { _id: 601817ef2eeecd17db3a68f7,
        name: 'Jose' } ],
   groupData:
    [ { _id: 606632403fffb851b8c41d12,
        name: 'Giraia' } ],
   members:
    [ { _id: 601817dc2eeecd17db3a68f6,
        name: 'Maria' },
      { _id: 601817ef2eeecd17db3a68f7,
        name: 'Jose' },
      { _id: 60182cbb2b654330d2458f89,
        name: 'Jonas'} ] } 
</code></pre>
<p>The last step in the pipeline would be to compare the arrays, filter which <code>members</code> were not <code>candidates</code> and add them to the array <code>stillAvailable</code>. I tried in many ways but I couldn't achieve my goal with aggregation. The only solution I could find was to process the result of the incomplete pipeline on my backend. The code is:</p>
<pre><code>  orders.forEach(
    (order) =&gt;
      (order.stillAvailable = order.members.filter(
        (autonomous) =&gt;
          !order.candidate.some((el) =&gt; {
            return el._id.toString() === autonomous._id.toString();
          })
      ))
  );
</code></pre>
<p>With that, I reach the expected output...</p>
<pre><code> { candidate:
    [ { _id: 601817dc2eeecd17db3a68f6,
       name: 'Maria' },
      { _id: 601817ef2eeecd17db3a68f7,
       name: 'Jose' } ],
   groupData:
    [ { _id: 606632403fffb851b8c41d12,
        name: 'Giraia' ],
   members:
    [ { _id: 601817dc2eeecd17db3a68f6,
        name: 'Maria' },
      { _id: 601817ef2eeecd17db3a68f7,
        name: 'Jose' },
      { _id: 60182cbb2b654330d2458f89,
        name: 'Jonas' ],
   stillAvailable:
    [ { _id: 60182cbb2b654330d2458f89,
        name: 'Jonas' ] }
</code></pre>
<p><strong>The problem is</strong> to better compartmentalize my code, it would be necessary to realize the last step (done with javascript on my backend) as one more step on the pipeline. Does anyone have an idea how to reach that?</p>

