Aggregate MongoDB query within nested arrays over multiple documents<p>I am doing a little hobby project for friends' disc golf results.</p>
<p>I'm fairly new to MongoDB and I've stuck on a query. What I want to do is to return a JSON object on the form <code>[{player: &quot;Name&quot;, totalThrows: (sum of Totalt field), total+/-: (sum of +/- field)}]</code>.</p>
<p>So in short: I want to aggregate each players total throws (Total field) and total+/-, over 3 different documents in my database.</p>
<p>The final JSON would look like this: <code>[{player: &quot;Tormod&quot;, totalThrows: 148, total+/-: 24}, {player: &quot;Martin&quot;, totalThrows: 149, total+/-: 25}, {player: &quot;Andreas&quot;, totalThrows: 158, total+/-: 34}]</code></p>
<p>The picture below shows my document as it's saved in MongoDB. The results array consist of the results of a specific player discgolf results. There is also not a set order on which player is first in the results array in the different documents. Each document represents a new round (think of playing 3 different days).</p>
<p><a href="https://i.stack.imgur.com/E8K1E.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/E8K1E.png" alt="enter image description here" /></a></p>
<p>Code:</p>
<pre><code>aggregate(
        [
            {$unwind: &quot;$results&quot;},
            {$group: { 
                player: &quot;$results.PlayerName&quot;,
                throws: &quot;$results.Totalt&quot;
            }},
            {$group: {
                _id: &quot;$_id&quot;, 
                totalThrows: {$sum: &quot;$results.Totalt&quot;}
            }}
        ])
</code></pre>
<p><a href="https://mongoplayground.net/p/aaKv3aaCeCi" rel="nofollow noreferrer">https://mongoplayground.net/p/aaKv3aaCeCi</a></p>

