// routes middleware
app.use(&quot;/api&quot;, blogRoutes);
app.use(&quot;/api&quot;, authRoutes);

// port
const port = process.env.PORT || 8000;
app.listen(port, () =&gt; {
  console.log(`Server is running on port ${port}`);
});
</code></pre>
<p>Now on my POSTMAN, I tried to put the data using <code>POST http://localhost:8000/api/signup</code> with the header and raw setup right.</p>
<pre><code>{
    &quot;name&quot;: &quot;SyRyan&quot;,
    &quot;email&quot;: &quot;syryan@gmail.com&quot;,
    &quot;password&quot;: &quot;brace1010&quot;
}
</code></pre>
<p>The database is connected but the postman takes forever to load the json request back. Am I making any mistakes here? Please help!</p>

