MongoDB - Find documents whose multiple fields are not present in another collection<p>I have MongoDB database and I am trying to return those documents that do not have more than one field in another collection/array. Example data I want filter:</p>
<pre><code>[
  {
    id: &quot;1&quot;,
    version: &quot;1&quot;,
    data: &quot;test&quot;
  },
  {
    id: &quot;2&quot;,
    version: &quot;3&quot;,
    data: &quot;test&quot;
  },
  {
    id: &quot;3&quot;,
    version: &quot;2&quot;,
    data: &quot;test&quot;
  }
]
</code></pre>
<p>I need to get those that are <strong>not</strong> present in an array like this:</p>
<pre><code>[
  {
    id: &quot;2&quot;,
    version: &quot;2&quot;,
  },
  {
    id: &quot;3&quot;,
    version: &quot;2&quot;,
  }
]
</code></pre>
<p>For this example it should return documents:</p>
<ul>
<li>id: 1 - id not present in filter array at all</li>
<li>id: 2 - id is present but &quot;version&quot; field does not match</li>
</ul>
<p>Use case is to return documents that were not shown in current version. I tried to use $nin but that only supports a collection of values to filter single field. If I use it in $and operator it compares it independently. I also setup a simple playground:
<a href="https://mongoplayground.net/p/JlKS0asGyrg" rel="nofollow noreferrer">MongoDB playground</a></p>

