<p>When creating adding some data to the database, Strapi automatically creates some fields - like <code>created_by</code> and <code>updated_by</code> fields, but I'm not getting them in the API response.</p>
<p>This is the data stored in MongoDB:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;606fd90b0057c05954d29f50&quot;
    },
    &quot;likes&quot;: 0,
    &quot;dislikes&quot;: 0,
    &quot;Title&quot;: &quot;Why is this not working?&quot;,
    &quot;Subtitle&quot;: &quot;I really don't know&quot;,
    &quot;slug&quot;: &quot;why-is-this-not-working&quot;,
    &quot;content&quot;: &quot;**I DO NOT KNOW**&quot;,
    &quot;published_at&quot;: {
        &quot;$date&quot;: &quot;2021-04-09T04:33:17.304Z&quot;
    },
