        &quot;$date&quot;: &quot;2021-04-09T04:33:15.232Z&quot;
    },
    &quot;updatedAt&quot;: {
        &quot;$date&quot;: &quot;2021-04-09T04:33:17.316Z&quot;
    },
    &quot;__v&quot;: 0,
    &quot;created_by&quot;: {
